import React from 'react'
import Navbar from './Navbar'
import Header from "./Header"
import Particles from "react-particles-js"


const Home = () => {
    return (
        <div>
            <Navbar></Navbar>
            <Header></Header>
            <Particles></Particles>
        </div>
    )
}

export default Home;
